El color de tu cabello habla por ti: castaño, rojizo, rubio, azul , verde. Aunque no sea natural, el color que llevamos en nuestras cabelleras contribuye en como nos sentimos y en la forma en que la gente nos ve.

O si no que lo diga la #lanenafina 
